    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    National Wildlife Refuge summarizes refuge activities during the 1993 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
    Land acquisition including fee title is also covered. The report includes a planning
    section which discusses master plans and management plans.  Refuge administration
    is outlined; information about personnel, other manpower programs, volunteer programs,
    funding, safety, and other is given.  Habitat management is also covered.  Subjects
    include general, wetlands, forests, croplands, grasslands, other habitats, grazing,
    haying, fire management, pest control, and wilderness and special areas.  The wildlife
    section of the report discusses wildlife diversity, endangered and/or threatened
    species, waterfowl, marsh and water birds, shorebirds, gulls, terns and allied species,
    raptors, other migratory birds, game mammals, other resident wildlife and fisheries
    resources.  The public uses of the refuge described in this report include general,
    outdoor classrooms u2013students, interpretive foot trails, interpretive tour routes,
    other interpretive programs, hunting, fishing, wildlife observation, camping, off-road
    vehicling, law enforcement and concessions.  The equipment and facilities section
    of the report provides information about rehabilitation, major maintenance, equipment
    utilization and replacement, communications systems,  computer systems and energy
    conservation.  Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
